import React from 'react';
import {BrowserRouter as Router, Routes, Navigate,Switch } from 'react-router-dom';
//import  from 'react-router';

//react-router
import Users from './users/pages/users';

function App() {
  return <Router>
    <Switch>
    <Routes path="/" exact>
      <Users></Users>
    </Routes>
    <Navigate to="/" />
    </Switch>
  </Router>;
};

export default App;
